import React, {useState, useEffect} from "react";
import {Link} from "react-router-dom";
import SearchBar from "../SearchBar";
import {useTranslation} from "react-i18next";

const OrderList = (props) => {
    const [offers, setOffers] = useState([]);
    const [translate, i18n] = useTranslation("global");
    const [searched, setSearched] = useState('');

    useEffect(() => {
        fetch("http://localhost:3001/getBrandOrders/"+ props.user.id)
            .then(res => res.json())
            .then(data => {
                setOffers(data)
            })
            .catch(err => alert(translate("operation_unsuccessful")));
    }, []);

    const deleteOffer = (offerId) => {
        if (window.confirm(translate("offer_delete_confirm")) === true) {
            fetch("http://localhost:3001/deleteProduct/" + offerId, {method: "DELETE"})
                .catch(err => alert(translate("operation_unsuccessful")));
        }
    }

    const offerList = offers.map((offer) => {
        return (
            <tbody key={offer.id}>
            <tr>
                <th>{offer.id}</th>
                <td>{offer.name}</td>
                <td>{offer.description}</td>
                <td>{offer.price}</td>
                <td>{offer.category}</td>
                <td><Link to={"/brand/productVariant/"+offer.id}>{translate("add_amount")}</Link></td>
                <td><Link to={offer.id + "/"}>{translate("details")}</Link></td>
                <td><Link to={"/emp/edit_offer/" + offer.id}>{translate("edit")}</Link></td>
                <td><a onClick={() => deleteOffer(offer.id)} className="underlined">{translate("delete")}</a></td>
            </tr>
            </tbody>
        );
    });

    return (
        <div className="center container">
            <h1>{translate("offers")}</h1>
            <SearchBar setSearched={setSearched}/><br/>
            <select>
                <option value=''></option>
                <option value={'pending'}>{translate("pending")}</option>
                <option value={'processing'}>{translate("processing")}</option>
                <option value={'completed'}>{translate("completed")}</option>
            </select>
            <table>
                <thead>
                <tr>
                    <th>id</th>
                    <th>{translate("name")}</th>
                    <th>{translate("description")}</th>
                    <th>{translate("price")}</th>
                    <th>{translate("category")}</th>
                    <th>{translate("add_amount")}</th>
                    <th>{translate("reviews")}</th>
                    <th>{translate("edit")}</th>
                    <th>{translate("delete")}</th>
                </tr>
                </thead>
                {offerList}
            </table>
        </div>
    );
};

export default OrderList;
